import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import './Schedule.css';

const Schedule = () => {
  const { currentUser } = useAuth();
  const [workouts, setWorkouts] = useState([]);
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);
  const [activeSeason, setActiveSeason] = useState('Spring');

  useEffect(() => {
    // Load saved workouts from localStorage
    const savedWorkouts = localStorage.getItem('workouts');
    if (savedWorkouts) {
      setWorkouts(JSON.parse(savedWorkouts));
    }
  }, []);

  const handleSignup = (workoutId) => {
    if (!currentUser) {
      alert('Please log in to sign up for workouts');
      return;
    }

    const updatedWorkouts = workouts.map(workout => {
      if (workout.id === workoutId) {
        const isSignedUp = workout.participants.includes(currentUser.id);
        if (isSignedUp) {
          // Remove user from participants
          return {
            ...workout,
            participants: workout.participants.filter(id => id !== currentUser.id)
          };
        } else {
          // Add user to participants
          return {
            ...workout,
            participants: [...workout.participants, currentUser.id]
          };
        }
      }
      return workout;
    });

    setWorkouts(updatedWorkouts);
    localStorage.setItem('workouts', JSON.stringify(updatedWorkouts));
  };

  const isSignedUp = (workoutId) => {
    if (!currentUser) return false;
    const workout = workouts.find(w => w.id === workoutId);
    return workout && workout.participants.includes(currentUser.id);
  };

  const filteredWorkouts = workouts.filter(workout => 
    workout.date === selectedDate
  );

  return (
    <div className="schedule-container">
      <div className="container">
        <h1 className="section-title">Workout Schedule</h1>
        <p className="section-subtitle">Sign up for team workouts and training sessions</p>

        {/* Season Tabs */}
        <div className="season-tabs">
          <button
            className={`season-tab ${activeSeason === 'Spring' ? 'active' : ''}`}
            onClick={() => setActiveSeason('Spring')}
          >
            Spring
          </button>
          <button
            className={`season-tab ${activeSeason === 'Summer' ? 'active' : ''}`}
            onClick={() => setActiveSeason('Summer')}
          >
            Summer
          </button>
          <button
            className={`season-tab ${activeSeason === 'Winter' ? 'active' : ''}`}
            onClick={() => setActiveSeason('Winter')}
          >
            Winter
          </button>
        </div>

        {/* Date Selector */}
        <div className="date-selector">
          <label htmlFor="date">Select Date:</label>
          <input
            type="date"
            id="date"
            value={selectedDate}
            onChange={(e) => setSelectedDate(e.target.value)}
            min={new Date().toISOString().split('T')[0]}
          />
        </div>

        {/* Workouts List */}
        <div className="workouts-list">
          {filteredWorkouts.length === 0 ? (
            <div className="no-workouts">
              <p>No workouts scheduled for this date.</p>
              {currentUser && (
                <p>Check back later or ask your coach to add workouts!</p>
              )}
            </div>
          ) : (
            filteredWorkouts.map(workout => (
              <div key={workout.id} className="workout-card">
                <div className="workout-header">
                  <div className="workout-time">
                    <span className="time">{workout.time}</span>
                    <span className="duration">{workout.duration}</span>
                  </div>
                  <div className="workout-type">
                    <span className={`type-badge ${workout.type.toLowerCase()}`}>
                      {workout.type}
                    </span>
                  </div>
                </div>

                <div className="workout-details">
                  <h3>{workout.title}</h3>
                  <p>{workout.description}</p>
                  <div className="workout-info">
                    <span>üìç {workout.location}</span>
                    <span>üë• {workout.participants.length}/{workout.maxParticipants} participants</span>
                  </div>
                </div>

                <div className="workout-actions">
                  {currentUser ? (
                    <button
                      onClick={() => handleSignup(workout.id)}
                      className={`signup-btn ${isSignedUp(workout.id) ? 'signed-up' : ''}`}
                    >
                      {isSignedUp(workout.id) ? '‚úì Signed Up' : 'Sign Up'}
                    </button>
                  ) : (
                    <button className="signup-btn disabled" disabled>
                      Login to Sign Up
                    </button>
                  )}
                </div>
              </div>
            ))
          )}
        </div>

        {/* Sample Workouts for Demo */}
        {workouts.length === 0 && (
          <div className="demo-workouts">
            <h3>Sample Workouts - {activeSeason} Season</h3>
            <p>These are sample workouts for the {activeSeason.toLowerCase()} season. In a real app, coaches would add actual workouts.</p>

            {activeSeason === 'Spring' && (
              <div className="season-schedule">
                <h4>Weekly Spring Schedule</h4>
                <div className="schedule-grid">
                  <div className="schedule-day">
                    <h5>Monday</h5>
                    <div className="workout-item swim">Swim 8:30-10:30</div>
                    <div className="workout-item bike">Outdoor Ride 6:15-7:30</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Tuesday</h5>
                    <div className="workout-item swim">Swim 8:30-10:30</div>
                    <div className="workout-item run">Track Run 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Wednesday</h5>
                    <div className="workout-item bike">Outdoor Ride 6:15-7:30</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Thursday</h5>
                    <div className="workout-item swim">Swim 8:30-10:30</div>
                    <div className="workout-item run">Tempo Run 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Friday</h5>
                    <div className="workout-item brick">Brick Session</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Saturday</h5>
                    <div className="workout-item long">Long Distance</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Sunday</h5>
                    <div className="workout-item recovery">Recovery</div>
                  </div>
                </div>
              </div>
            )}

            {activeSeason === 'Summer' && (
              <div className="season-schedule">
                <h4>Weekly Summer Schedule</h4>
                <div className="schedule-grid">
                  <div className="schedule-day">
                    <h5>Monday</h5>
                    <div className="workout-item swim">Open Water Swim</div>
                    <div className="workout-item bike">Long Ride 6:00-8:00</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Tuesday</h5>
                    <div className="workout-item swim">Pool Session 7:00-9:00</div>
                    <div className="workout-item run">Trail Run 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Wednesday</h5>
                    <div className="workout-item bike">Hill Training 6:15-7:30</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Thursday</h5>
                    <div className="workout-item swim">Pool Session 7:00-9:00</div>
                    <div className="workout-item run">Speed Work 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Friday</h5>
                    <div className="workout-item brick">Brick Session</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Saturday</h5>
                    <div className="workout-item long">Race Simulation</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Sunday</h5>
                    <div className="workout-item recovery">Active Recovery</div>
                  </div>
                </div>
              </div>
            )}

            {activeSeason === 'Winter' && (
              <div className="season-schedule">
                <h4>Weekly Winter Schedule</h4>
                <div className="schedule-grid">
                  <div className="schedule-day">
                    <h5>Monday</h5>
                    <div className="workout-item swim">Indoor Swim 8:30-10:30</div>
                    <div className="workout-item bike">Indoor Cycling 6:15-7:30</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Tuesday</h5>
                    <div className="workout-item swim">Indoor Swim 8:30-10:30</div>
                    <div className="workout-item run">Indoor Track 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Wednesday</h5>
                    <div className="workout-item bike">Indoor Cycling 6:15-7:30</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Thursday</h5>
                    <div className="workout-item swim">Indoor Swim 8:30-10:30</div>
                    <div className="workout-item run">Treadmill 6:15</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Friday</h5>
                    <div className="workout-item brick">Indoor Brick</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Saturday</h5>
                    <div className="workout-item long">Indoor Training</div>
                  </div>
                  <div className="schedule-day">
                    <h5>Sunday</h5>
                    <div className="workout-item recovery">Rest Day</div>
                  </div>
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default Schedule;
